// ---creating App.jsx component---

import React from 'react';
import Heading from './Heading';
import Para from './Para';
import List from './List';

function App(){
    return (
        <>
            <Heading/>
            <Para/>
            <List/>
            <Para/>
        </>
    )
}
export default App;
